    var add_button = new ymaps.control.Button({
        data: {
            title: 'Добавить яму',
            content: '<i class="glyphicon glyphicon-plus"></i> Новая яма'
        },
        options: {
          layout: ymaps.templateLayoutFactory.createClass("<div class='btn btn-danger btn-lg'>$[data.content]</div>"),
          maxWidth: [150, 178],
          selectOnClick: false,
       },
    });
    add_button.events.add('click', function() {
      window.location.href = "add.html";
    })
      myMap.controls.add(add_button);

    objectManager_need = new ymaps.ObjectManager({
      clusterize: true,
      gridSize: 32
    });

    objectManager_accept = new ymaps.ObjectManager({
      clusterize: true,
      gridSize: 32
    });

    objectManager_ok = new ymaps.ObjectManager({
      clusterize: true,
      gridSize: 32
    });

    /* objectManager_upr = new ymaps.ObjectManager({
      clusterize: true,
      gridSize: 32
    }); */

    //objectManager_roads = new ymaps.ObjectManager();


    for(var i=0;i<enStatus.length; i++) {
        Collection[enStatus[i]] = new ymaps.GeoObjectCollection();
        myMap.geoObjects.add(Collection[enStatus[i]]);
      }


    objectManager_need.clusters.options.set('preset', 'islands#redClusterIcons');
    objectManager_accept.clusters.options.set('preset', 'islands#yellowClusterIcons');
    objectManager_ok.clusters.options.set('preset', 'islands#greenClusterIcons');
